  false,\n\t\"url\": null,\n\t\"notes\": \"These data sets are in the form of ninety
  one QuattroPro spreadsheets representing tree core data on study plots on five BLM
  Districts in western Oregon. Data was collected from 1993-1995 primarily on BLM
  lands to compare past thinnings (10-25 years old) to immediately adjacent unthinned
  stands and nearby old-growth where available. Data is focused on overstory trees,
  saplings, seedlings, shrubs and herbaceous plant cover in the various stand types.\",\n\t\"license_title\":
